Legal Alcohol Tracker AR will help you to select good spirits using fast scanning of the tax stamp and the augmented reality mode. Scan the bottle before purchasing to check the alcohol legality. 

The application uses the official Excises Database and will help you to define the counterfeit spirits.

Make 3 simple steps to define the legality of alcohol:
1. Select the alcohol type (wine, vodka, whisky) and determine the bottle size;
2. Point the camera and scan the tax stamp barcode;
3. Useful tips in the AR mode will help you to select alcoholic beverages.

Now you can quickly check the alcohol's legality directly in the shop before the purchase. If the information contained in the tax stamp and on the bottle don't match, the alcoholic drink is counterfeit.

Features:
Barcode scanner with the AR mode;
The hints allowing to define the counterfeit;
Scanning history with barcode numbers;
Map view of scanning geo.

Learn more about alcoholic beverages and buy only high-quality products with Legal Alcohol Tracker AR.
***Please notice that now application works only with Excises Database of Russian Federation.

